import React, { Component } from 'react'

class BMICalculator extends Component {
  render() {
    return (
      <div id="divContainer">
        <div id="divHead">BMI Calculator</div>
        <div id="divInputs">
            <label>Enter weight</label><input type="number"/><select><option>kg-metres</option><option>lbs-inches</option></select>
            <label>Enter height</label><input type="number"/>
        </div>
        <div>
            <p>18.4</p>
            <p>Underweight</p>
        </div>
      </div>
    )
  }
}

export default BMICalculator
